import React from "react";

export const PackCard = ({ opts }) => {
  const { name, includes, dealerPrice, retailPrice } = opts;
  return (
    <div>
      <h3 className="pack-name">{name}:</h3>
      <ul>
        {includes.map((el) => (
          <li>{el}</li>
        ))}
      </ul>
      <h4>Dealer Price: {dealerPrice}</h4>
      <h4>Suggested Retail Price: {retailPrice}</h4>
    </div>
  );
};
